import { useState } from "react";
import SearchResultsItem from "./SearchResultsItem";
import Chip from '@mui/material/Chip';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import DeviceThermostatIcon from '@mui/icons-material/DeviceThermostat';
import EditLocationIcon from '@mui/icons-material/EditLocation';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

export default function SearchResults({ results, isSearching, lnoticias, mensajerror }) {     
    //console.log(lnoticias.articles);
    console.log(results.main);
    return(        
        <div style={{ 
            width: "100%",
            justifyContent: "center",
            display: "block",
            flexDirection: "column",
            width: "100%",
            alignItems: "center",
        }}>
            <Grid container spacing={2} columns={16}>
        <Grid item xs={8}>
        {results.length < 1  ? <p>{mensajerror}</p>
                :                              
                <Box sx={{ width: '100%', bgcolor: 'background.paper' }}>
                    <Box sx={{ my: 3, mx: 2 }}>
                    <Grid container alignItems="center">
                        <Grid item xs>
                        <Typography gutterBottom variant="h4" component="div">
                            {results.name}
                        </Typography>
                        </Grid>
                        <Grid item>
                        <Typography gutterBottom variant="h6" component="div">
                        {results.sys && results.sys.country} <EditLocationIcon />
                        </Typography>
                        </Grid>
                    </Grid>                    
                    </Box>
                    <Divider variant="middle" />
                    <Box sx={{ m: 2 }}>
                    <Typography gutterBottom variant="body1">
                        Datos de humedad
                    </Typography>
                    <Stack direction="row" spacing={1}>
                        <Chip label={results.main && "Humedad: "+results.main.humidity} />
                        <Chip color="primary" label={results.main && "PresÃ­on: "+results.main.pressure} />
                        <Chip label={results.main && "Temperatura: "+results.main.temp} />
                    </Stack>
                    </Box>
                    <Box sx={{ mt: 3, ml: 1, mb: 1 }}>                                         
                    </Box>
                </Box>
                }
        </Grid>
        <Grid item xs={8}>
            {lnoticias.articles &&
                // <SearchResultsItem inoticias={lnoticias.articles && lnoticias.articles} msjerror={mensajerror}/> 
                <Card sx={{ maxWidth: 345, m: 2 }}>
      <CardHeader>
            <Avatar
              alt="Ted talk"
              src="https://pbs.twimg.com/profile_images/877631054525472768/Xp5FAPD5_reasonably_small.jpg"
            />

            <IconButton aria-label="settings">
              <MoreVertIcon />
            </IconButton>
        
        
            <Skeleton
              animation="wave"
              height={10}
              width="80%"
              style={{ marginBottom: 6 }}
            />
          
        
            <Skeleton animation="wave" height={10} width="40%" />
          
            '5 hours ago'
          
        </CardHeader>
        <CardMedia
          component="img"
          height="140"
          image="https://pi.tedcdn.com/r/talkstar-photos.s3.amazonaws.com/uploads/72bda89f-9bbf-4685-910a-2f151c4f3a8a/NicolaSturgeon_2019T-embed.jpg?w=512"
          alt="Nicola Sturgeon on a TED talk stage"
        />

      <CardContent>
          <Typography variant="body2" color="text.secondary" component="p">
            {
              "Why First Minister of Scotland Nicola Sturgeon thinks GDP is the wrong measure of a country's success:"
            }
          </Typography>
      </CardContent>
    </Card>
            }
        </Grid>
      </Grid>             
        </div>        
    );
}
